--------------------------------------------------------------------------------
-- generation
--------------------------------------------------------------------------------

data Ty = Int | Ty :-> Ty | Ty :+: Ty
  deriving (Eq, Show)
type Vars = [(Name, Ty)]

(-.) :: Int -> Int -> Int
n -. m | n == 0 = 0
       | otherwise = n - m

choose :: [a] -> IO a
choose xs = (xs !!) `fmap` getStdRandom (randomR (0, length xs - 1))

genT :: Int -> IO Ty
genT 0 = return Int
genT n = join (choose [ return Int
                      , liftM2 (:->) (genT (n - 1)) (genT (n - 1))
                      , liftM2 (:+:) (genT (n - 1)) (genT (n - 1))
                      ])

genConst :: Vars -> IO Expr
genConst vars = choose ([Const n | n <- [-20..20]] ++ [Var x | (x, Int) <- vars])

genLam :: Ty -> Ty -> Vars -> Int -> IO Expr
genLam t u vars n = join . choose $
                    (do x <- genVar vars
                        fmap (Lam x) (gen u ((x, t) : vars) (n -. 1))) :
                    [return (Var x) | (x, t') <- vars, t' == t :-> u]

genSum :: Ty -> Ty -> Vars -> Int -> IO Expr
genSum t1 t2 vars n = join . choose $
                      (do (c, t) <- choose [(OnLeft, t1), (OnRight, t2)]
                          fmap c (gen t vars (n -. 1))) :
                      [return (Var x) | (x, t) <- vars, t == t1 :+: t2]

genVar :: Vars -> IO String
genVar vs = do n <- choose [1..5]
               cs <- replicateM n (choose ['a'..'z'])
               if cs `elem` map fst vs
               then genVar vs
               else return cs

genAny :: Int -> IO Expr
genAny n = do t <- genT 3
              gen t [] n

gen :: Ty -> Vars -> Int -> IO Expr
gen Int vars 0 = genConst vars
gen Int vars n = join $ choose
                        [ genConst vars
                        , liftM2 Plus (gen Int vars (n - 1)) (gen Int vars (n - 1))
                        , liftM2 Times (gen Int vars (n - 1)) (gen Int vars (n - 1))
                        , genApp Int vars n
                        , genCase Int vars n ]
gen (t :-> u) vars 0 = genLam t u vars 0
gen (t :-> u) vars n = join $ choose
                              [ genLam t u vars n
                              , genApp (t :-> u) vars n
                              , genCase (t :-> u) vars n]
gen (t :+: u) vars 0 = genSum t u vars 0
gen (t :+: u) vars n = join $ choose
                              [ genSum t u vars n
                              , genApp (t :+: u) vars n
                              , genCase (t :+: u) vars n]

genApp :: Ty -> Vars -> Int -> IO Expr
genApp t vars n = do u <- genT 3
                     liftM2 App (gen (u :-> t) vars (n - 1)) (gen u vars (n - 1))

genCase :: Ty -> Vars -> Int -> IO Expr
genCase t vars n = do u1 <- genT 3
                      u2 <- genT 3
                      l <- gen (u1 :+: u2) vars (n - 1)
                      x1 <- genVar vars
                      m1 <- gen t ((x1, u1) : vars) (n - 1)
                      x2 <- join $ choose [return x1, genVar vars]
                      m2 <- gen t ((x2, u2) : vars) (n - 1)
                      return (Case l x1 m1 x2 m2)

genUntyped :: Vars -> Int -> IO Expr
genUntyped vs 0 = join $ choose [ genConst vs
                                , fmap Var (genVar vs) ]
genUntyped vs n = join $ choose
                  [ genConst vs
                  , liftM2 Plus moar moar
                  , liftM2 Times moar moar
                  , Var <$> genVar vs
                  , do x <- genVar vs
                       Lam x <$> genUntyped ((x, Int) : vs) (n - 1)
                  , liftM2 App moar moar
                  , OnLeft <$> moar
                  , OnRight <$> moar
                  , do l <- moar
                       x1 <- genVar vs
                       m <- genUntyped ((x1, Int) : vs) (n - 1)
                       x2 <- join $ choose [return x1, genVar vs]
                       n <- genUntyped ((x2, Int) : vs) (n - 1)
                       return (Case l x1 m x2 n) ]
  where moar = genUntyped vs (n - 1)

hasVar :: Expr -> Bool
hasVar (Const _) = False
hasVar (Plus m n) = hasVar m || hasVar n
hasVar (Times m n) = hasVar m || hasVar n
hasVar (Var _) = True
hasVar (Lam _ m) = hasVar m
hasVar (App m n) = hasVar m || hasVar n
hasVar (OnLeft m) = hasVar m
hasVar (OnRight m) = hasVar m
hasVar (Case l _ m _ n) = hasVar l || hasVar m || hasVar n

hasApp :: Expr -> Bool
hasApp (Const _) = False
hasApp (Plus m n) = hasApp m || hasApp n
hasApp (Times m n) = hasApp m || hasApp n
hasApp (Var _) = False
hasApp (Lam _ m) = hasApp m
hasApp (App m n) = True
hasApp (OnLeft m) = hasApp m
hasApp (OnRight m) = hasApp m
hasApp (Case l _ m _ n) = hasApp l || hasApp m || hasApp n

hasCase :: Expr -> Bool
hasCase (Const _) = False
hasCase (Plus m n) = hasCase m || hasCase n
hasCase (Times m n) = hasCase m || hasCase n
hasCase (Var _) = False
hasCase (Lam _ m) = hasCase m
hasCase (App m n) = hasCase m || hasCase n
hasCase (OnLeft m) = hasCase m
hasCase (OnRight m) = hasCase m
hasCase (Case l _ m _ n) = True

hasLR  :: Expr -> Bool
hasLR (Const _) = False
hasLR (Plus m n) = hasLR m || hasLR n
hasLR (Times m n) = hasLR m || hasLR n
hasLR (Var _) = False
hasLR (Lam _ m) = hasLR m
hasLR (App m n) = hasLR m || hasLR n
hasLR (OnLeft m) = True
hasLR (OnRight m) = True
hasLR (Case l _ m _ n) = hasLR l || hasLR m || hasLR n

isConst :: Expr -> Bool
isConst (Const _) = True
isConst _         = False

(.&&.) :: (t -> Bool) -> (t -> Bool) -> t -> Bool
(f .&&. g) x = f x && g x

many :: Int -> (a -> Bool) -> IO a -> IO [a]
many 0 _ _ = return []
many n p m = do x <- m
                if p x
                then fmap (x :) (many (n - 1) p m)
                else many n p m

