test1, test2 :: Test

test1 = test [ assertBool ("Substituting (" ++ show v ++ ") for " ++ x ++ " in (" ++ show e ++ ") should give (" ++ show expected ++ "but you have (" ++ show actual ++ ")") (expected == actual) | (e, x, v, expected) <- appSubsts, let actual = substitute x v e]

test2 = test [ assertBool ("Substituting (" ++ show v ++ ") for " ++ x ++ " in (" ++ show e ++ ") should give (" ++ show expected ++ "but you have (" ++ show actual ++ ")") (expected == actual) | (e, x, v, expected) <- caseSubsts, let actual = substitute x v e]

test3, test4, test5 :: Test

test3 = test [ assertBool ("Evaluating (" ++ show e ++ ") should give (" ++ show expected ++ " but you have (" ++ show actual ++ ")") (Just expected == actual) | (e, expected) <- intExpsS, let actual = evalS e ]

test4 = test $ 
        [ assertBool ("Evaluating (" ++ show e ++ ") should give (" ++ show expected ++ " but you have (" ++ show actual ++ ")") (Just expected == actual) | (e, expected) <- appExpsS, let actual = evalS e ] ++
        [ assertBool ("Evaluating (" ++ show e ++ ") should fail, but you have (" ++ show actual ++ ")") (isNothing actual) | e <- badAppExps, let actual = evalS e ]        

test5 = test $
        [ assertBool ("Evaluating (" ++ show e ++ ") should give (" ++ show expected ++ " but you have (" ++ show actual ++ ")") (Just expected == actual) | (e, expected) <- caseExpsS, let actual = evalS e ] ++
        [ assertBool ("Evaluating (" ++ show e ++ ") should fail, but you have (" ++ show actual ++ ")") (isNothing actual) | e <- badCaseExps, let actual = evalS e ]        

test6, test7, test8 :: Test

test6 = test [ assertBool ("Evaluating (" ++ show e ++ ") should give (" ++ show expected ++ " but you have (" ++ show actual ++ ")") (Just expected == actual) | (e, expected) <- intExpsC, let actual = evalC [] e ]

test7 = test $ 
        [ assertBool ("Evaluating (" ++ show e ++ ") should give (" ++ show expected ++ " but you have (" ++ show actual ++ ")") (Just expected == actual) | (e, expected) <- appExpsC, let actual = evalC [] e ] ++
        [ assertBool ("Evaluating (" ++ show e ++ ") should fail, but you have (" ++ show actual ++ ")") (isNothing actual) | e <- badAppExps, let actual = evalC [] e ]        

test8 = test $
        [ assertBool ("Evaluating (" ++ show e ++ ") should give (" ++ show expected ++ " but you have (" ++ show actual ++ ")") (Just expected == actual) | (e, expected) <- caseExpsC, let actual = evalC [] e ] ++
        [ assertBool ("Evaluating (" ++ show e ++ ") should fail, but you have (" ++ show actual ++ ")") (isNothing actual) | e <- badCaseExps, let actual = evalC [] e ]                

